const database = getDatabase(app);

const V = [164, 276, 388, 499, 609, 720, 831, 941, 1050, 1159, 1270, 1380, 1489, 1599, 1710, 1822];
const H = [174, 284, 395, 506, 617, 728, 839, 949, 1060, 1171, 1280];

const BUILDINGS = {
  '0,5': {type: 'General_Store', points: 1}, '1,2': {type: 'Stable', points: 2}, '2,1': {type: 'School', points: 2},
  '2,4': {type: 'Saloon', points: 4}, '2,8': {type: 'Bank', points: 2}, '3,3': {type: 'Bank', points: 4},
  '3,6': {type: 'School', points: 3}, '4,2': {type: 'Jail', points: 3}, '4,7': {type: 'General_Store', points: 4},
  '5,4': {type: 'School', points: 5}, '5,8': {type: 'Stable', points: 3}, '6,0': {type: 'Saloon', points: 1},
  '6,5': {type: 'Stable', points: 5}, '6,9': {type: 'Jail', points: 1}, '7,3': {type: 'Jail', points: 5},
  '7,6': {type: 'Bank', points: 5}, '8,0': {type: 'Bank', points: 1}, '8,4': {type: 'General_Store', points: 5},
  '8,9': {type: 'School', points: 1}, '9,1': {type: 'General_Store', points: 3}, '9,5': {type: 'Saloon', points: 5},
  '10,2': {type: 'Stable', points: 4}, '10,7': {type: 'Bank', points: 3}, '11,3': {type: 'Saloon', points: 3},
  '11,6': {type: 'Jail', points: 4}, '12,1': {type: 'Jail', points: 2}, '12,5': {type: 'School', points: 4},
  '12,8': {type: 'Saloon', points: 2}, '13,7': {type: 'General_Store', points: 2}, '14,4': {type: 'Stable', points: 1}
};

const OUTHOUSES = [[1,4], [2,3], [2,6], [3,2], [3,7], [4,8], [5,3], [6,4], [7,5], [8,6], [10,1], [10,4], [11,2], [11,7], [12,3], [12,6], [13,5]];
const BUILDING_TYPES = ['Bank', 'General_Store', 'Jail', 'Saloon', 'School', 'Stable'];

const IMAGES = {
  board: "data:image/jpeg;base64,", worker: "data:image/jpeg;base64,",
  Road_1: "data:image/jpeg;base64,", Road_2: "data:image/jpeg;base64,",
  Road_3: "data:image/jpeg;base64,", Road_3__type_2_: "data:image/jpeg;base64,",
  River_1: "data:image/jpeg;base64,", River_2: "data:image/jpeg;base64,",
  River_3: "data:image/jpeg;base64,", River_3__type_2_: "data:image/jpeg;base64,",
  Railroad_1: "data:image/jpeg;base64,", Railroad_2: "data:image/jpeg;base64,",
  Railroad_3: "data:image/jpeg;base64,", Railroad_3__type_2_: "data:image/jpeg;base64,",
  Bank: "data:image/jpeg;base64,", General_Store: "data:image/jpeg;base64,",
  Jail: "data:image/jpeg;base64,", Saloon: "data:image/jpeg;base64,",
  School: "data:image/jpeg;base64,", Stable: "data:image/jpeg;base64,",
  Yes_1: "data:image/jpeg;base64,", Yes_2: "data:image/jpeg;base64,",
  Yes_3: "data:image/jpeg;base64,", No_1: "data:image/jpeg;base64,",
  No_2: "data:image/jpeg;base64,", No_3: "data:image/jpeg;base64,",
  Wildcard: "data:image/jpeg;base64,", Indifferent: "data:image/jpeg;base64,"
};
const normalizeCollection = (collection) => (
  Array.isArray(collection) ? collection.filter(Boolean) : Object.values(collection || {}).filter(Boolean)
);

const RED_WORKER_IMAGE = "data:image/svg+xml,%3Csvg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 576 566'%3E%3Cdefs%3E%3CradialGradient id='g' cx='33%25' cy='34%25' r='72%25'%3E%3Cstop offset='0%25' stop-color='%23ff4a3f'/%3E%3Cstop offset='58%25' stop-color='%23e00707'/%3E%3Cstop offset='100%25' stop-color='%23b40000'/%3E%3C/radialGradient%3E%3C/defs%3E%3Ccircle cx='288' cy='283' r='272' fill='url(%23g)'/%3E%3Cpath d='M89 183c24-38 57-68 110-88 97-35 193-15 266 39' fill='none' stroke='%23ff8a63' stroke-width='21' opacity='.26'/%3E%3Cellipse cx='198' cy='284' rx='57' ry='39' fill='%23ffb09a' opacity='.35'/%3E%3Cellipse cx='244' cy='296' rx='22' ry='16' fill='%23ffb09a' opacity='.4'/%3E%3Cpath d='M182 431c84-16 132-16 216 0' fill='none' stroke='%239a0000' stroke-width='10' opacity='.55'/%3E%3C/svg%3E";
IMAGES.worker = RED_WORKER_IMAGE;

export default function App() {
  const [roomId, setRoomId] = useState('');
  const [playerId, setPlayerId] = useState('');
  const [playerName, setPlayerName] = useState('');
  const [inLobby, setInLobby] = useState(true);
  const [gameState, setGameState] = useState(null);
  const [myPlayerIndex, setMyPlayerIndex] = useState(null);
  
  // Local UI state (not synced)
  const [dragging, setDragging] = useState(null);
  const [validMoves, setValidMoves] = useState([]);
  const [previewMove, setPreviewMove] = useState(null);
  const [dragPos, setDragPos] = useState({x: 0, y: 0});
  const [wildcardChoice, setWildcardChoice] = useState(null);
  const [hoveredTileIndex, setHoveredTileIndex] = useState(null);
  const [viewedPlayerName, setViewedPlayerName] = useState('');
  
  const boardRef = useRef(null);
  const roomRef = useRef(null);
  const voteRevealTimerRef = useRef(null);

  // Generate or retrieve player ID
  useEffect(() => {
    let pid = localStorage.getItem('wackyWestPlayerId');
    if (!pid) {
      pid = `player_${Math.random().toString(36).substr(2, 9)}`;
      localStorage.setItem('wackyWestPlayerId', pid);
    }
    setPlayerId(pid);

    // Check URL for room ID
    const params = new URLSearchParams(window.location.search);
    const urlRoomId = params.get('room');
    if (urlRoomId) {
      setRoomId(urlRoomId);
    }
  }, []);

  // Listen to game state changes
  useEffect(() => {
    if (!roomId) return;
    
    // Validate room ID - must be alphanumeric only
    const cleanRoomId = roomId.trim().replace(/[^A-Z0-9]/gi, '').toUpperCase();
    if (!cleanRoomId || cleanRoomId.length < 4) {
      console.error('Invalid room ID:', roomId);
      return;
    }
    
    roomRef.current = ref(database, `rooms/${cleanRoomId}`);
    const unsubscribe = onValue(roomRef.current, (snapshot) => {
      const data = snapshot.val();
      if (data) {
        setGameState(data);
        
        // Find my player index
        if (data.players) {
          const myIndex = data.players.findIndex(p => p.id === playerId);
          if (myIndex !== -1) {
            setMyPlayerIndex(myIndex);
            setInLobby(false);
          }
        }
      }
    });

    return () => unsubscribe();
  }, [roomId, playerId]);

  // Setup disconnect handler
  useEffect(() => {
    if (!roomId || myPlayerIndex === null || !gameState) return;
    
    const playerRef = ref(database, `rooms/${roomId}/players/${myPlayerIndex}`);
    const connectedRef = onDisconnect(playerRef);
    connectedRef.update({ connected: false });

    // Mark as connected
    update(playerRef, { connected: true });

    return () => {
      connectedRef.cancel();
    };
  }, [roomId, myPlayerIndex, gameState]);

  const createOrJoinRoom = async () => {
    if (!playerName.trim()) {
      alert('Please enter your name');
      return;
    }

    let rid = roomId;
    
    // Parse room ID from URL if full URL was pasted
    if (rid && (rid.includes('http://') || rid.includes('https://') || rid.includes('?room='))) {
      try {
        const url = new URL(rid.includes('http') ? rid : `https://${rid}`);
        const params = new URLSearchParams(url.search);
        rid = params.get('room') || rid;
      } catch (e) {
        // If parsing fails, try to extract room code manually
        const match = rid.match(/[?&]room=([A-Z0-9]{6})/i);
        if (match) {
          rid = match[1];
        }
      }
      rid = rid.trim().toUpperCase();
      setRoomId(rid);
    }
    
    if (!rid) {
      // Create new room
      rid = Math.random().toString(36).substr(2, 6).toUpperCase();
      setRoomId(rid);
      window.history.pushState({}, '', `?room=${rid}`);
      
      // Initialize room
      await set(ref(database, `rooms/${rid}`), {
        host: playerId,
        players: [{
          id: playerId,
          name: playerName,
          connected: true,
          seat: 0
        }],
        started: false,
        created: Date.now()
      });
    } else {
      // Join existing room
      const roomSnapshot = await get(ref(database, `rooms/${rid}`));
      const room = roomSnapshot.val();
      
      if (!room) {
        alert('Room not found!');
        return;
      }

      if (room.started && !room.players.some(p => p.id === playerId)) {
        alert('Game already started!');
        return;
      }

      // Check if player was in room before (reconnection)
      const existingPlayerIndex = room.players.findIndex(p => p.id === playerId);
      
      if (existingPlayerIndex !== -1) {
        // Reconnect
        await update(ref(database, `rooms/${rid}/players/${existingPlayerIndex}`), {
          connected: true,
          name: playerName
        });
      } else {
        // New player joining
        if (room.players.length >= 4) {
          alert('Room is full (max 4 players)');
          return;
        }

        await update(ref(database, `rooms/${rid}/players`), {
          [room.players.length]: {
            id: playerId,
            name: playerName,
            connected: true,
            seat: room.players.length
          }
        });
      }
    }
  };

  const startGame = async () => {
    if (!gameState || gameState.host !== playerId) return;

    const numPlayers = gameState.players.length;
    if (numPlayers < 2 || numPlayers > 4) {
      alert('Need 2-4 players to start');
      return;
    }

    await update(ref(database, `rooms/${roomId}`), createFreshGameState(gameState.players));
  };

  const restartGame = async () => {
    if (!gameState || gameState.host !== playerId) return;
    await update(ref(database, `rooms/${roomId}`), createFreshGameState(gameState.players));
    setDragging(null);
    setValidMoves([]);
    setPreviewMove(null);
  };

  const calcMovesForState = (tile, boardState, workersState, placedTilesState) => {
    const type = tile.type.startsWith('Road') ? 'road' : tile.type.startsWith('River') ? 'river' : 'railroad';
    const tracks = type === 'railroad' ? ['topsy','turvy'] : [type];
    const moves = [];
    tracks.forEach(track => {
      const w = workersState[track];
      [{dx:1,dy:0,r:0},{dx:0,dy:1,r:90},{dx:-1,dy:0,r:180},{dx:0,dy:-1,r:270}].forEach(d => {
        const cells = Array(tile.size).fill(0).map((_,i) => [w.c+d.dx*(i+1), w.r+d.dy*(i+1)]);
        const ok = cells.every(([c,r],i) => {
          if(c<0||c>14||r<0||r>9) return false;
          if((c===0&&r===0)||(c===14&&r===0)||(c===0&&r===9)||(c===14&&r===9)) return false;
          if(boardState[r][c].covered) return false;
          if(i===0) {
            const dc=Math.abs(c-w.c), dr=Math.abs(r-w.r);
            if(dc===1&&dr===0||dc===0&&dr===1) return true;
            return false;
          }
          return true;
        });
        if(ok) moves.push({cells,track,rot:d.r});
        
        const isBridgeCenter = (c0, r0) => placedTilesState.some(t => t.size===3 && t.cells[1] && t.cells[1][0]===c0 && t.cells[1][1]===r0);
        for(let span=1; span<=14; span++) {
          const crossed = Array(span).fill(0).map((_,i) => [w.c+d.dx*(i+1), w.r+d.dy*(i+1)]);
          const crossedAreValidBridgeCenters = crossed.every(([c,r]) => {
            if(c<0||c>14||r<0||r>9) return false;
            if(!boardState[r][c].covered) return false;
            return isBridgeCenter(c, r);
          });
          if(!crossedAreValidBridgeCenters) break;

          const landingCells = Array(tile.size).fill(0).map((_,i) => [w.c+d.dx*(span+i+1), w.r+d.dy*(span+i+1)]);
          const canLand = landingCells.every(([c,r]) => {
            if(c<0||c>14||r<0||r>9) return false;
            if((c===0&&r===0)||(c===14&&r===0)||(c===0&&r===9)||(c===14&&r===9)) return false;
            if(boardState[r][c].covered) return false;
            return true;
          });
          if(canLand) moves.push({cells:landingCells,track,rot:d.r});
        }
      });
    });
    return moves;
  };

  const calculateScores = (boardState, secretBuildingsState, playersArray) => {
    const newScores = {};
    playersArray.forEach(player => {
      const building = secretBuildingsState[player];
      if(!building) return;
      let lostPoints = 0;
      Object.entries(BUILDINGS).forEach(([key, bldg]) => {
        if(bldg.type === building) {
          const [c, r] = key.split(',').map(Number);
          if(boardState[r][c].covered) lostPoints += bldg.points;
        }
      });
      newScores[player] = 15 - lostPoints;
    });
    return newScores;
  };

  const getNormalizedPlayers = (playersState) => normalizeCollection(playersState);

  const createFreshGameState = (playersState) => {
    const normalizedPlayers = getNormalizedPlayers(playersState);
    const numPlayers = normalizedPlayers.length;
    const players = normalizedPlayers.map(p => p.name);
    const board = Array(10).fill(0).map(() => Array(15).fill(0).map(() => ({covered: false})));
    const workers = {topsy: {c:0, r:0}, road: {c:14, r:0}, river: {c:0, r:9}, turvy: {c:14, r:9}};

    const all = [];
    for(let i=0; i<6; i++) all.push({id:`r1-${i}`,type:'Road_1',size:1});
    for(let i=0; i<6; i++) all.push({id:`r2-${i}`,type:'Road_2',size:2});
    for(let i=0; i<1; i++) all.push({id:`r3-${i}`,type:'Road_3',size:3});
    for(let i=0; i<2; i++) all.push({id:`r3t-${i}`,type:'Road_3__type_2_',size:3});
    for(let i=0; i<6; i++) all.push({id:`ri1-${i}`,type:'River_1',size:1});
    for(let i=0; i<6; i++) all.push({id:`ri2-${i}`,type:'River_2',size:2});
    for(let i=0; i<2; i++) all.push({id:`ri3-${i}`,type:'River_3',size:3});
    for(let i=0; i<1; i++) all.push({id:`ri3t-${i}`,type:'River_3__type_2_',size:3});
    for(let i=0; i<12; i++) all.push({id:`rr1-${i}`,type:'Railroad_1',size:1});
    for(let i=0; i<12; i++) all.push({id:`rr2-${i}`,type:'Railroad_2',size:2});
    for(let i=0; i<3; i++) all.push({id:`rr3-${i}`,type:'Railroad_3',size:3});
    for(let i=0; i<3; i++) all.push({id:`rr3t-${i}`,type:'Railroad_3__type_2_',size:3});
    all.sort(() => Math.random() - 0.5);

    const shuffledBuildings = [...BUILDING_TYPES].sort(() => Math.random() - 0.5);
    const secretBuildings = {};
    players.forEach((name, i) => {
      secretBuildings[name] = shuffledBuildings[i % BUILDING_TYPES.length];
    });

    const dealtTiles = {};
    players.forEach(name => dealtTiles[name] = []);
    const groupedByFamily = {};
    all.forEach(tile => {
      const family = tile.type.replace('__type_2_', '');
      if (!groupedByFamily[family]) groupedByFamily[family] = [];
      groupedByFamily[family].push(tile);
    });

    if (numPlayers === 2) {
      let oddGoesTo = 0;
      Object.values(groupedByFamily).forEach(group => {
        const shuffled = [...group].sort(() => Math.random() - 0.5);
        const half = Math.floor(shuffled.length / 2);
        dealtTiles[players[0]].push(...shuffled.slice(0, half));
        dealtTiles[players[1]].push(...shuffled.slice(half, half * 2));
        if(shuffled.length % 2 === 1) {
          dealtTiles[players[oddGoesTo]].push(shuffled[shuffled.length - 1]);
          oddGoesTo = 1 - oddGoesTo;
        }
      });
    } else {
      let playerIndex = 0;
      Object.values(groupedByFamily).forEach(group => {
        const shuffled = [...group].sort(() => Math.random() - 0.5);
        shuffled.forEach(tile => {
          dealtTiles[players[playerIndex]].push(tile);
          playerIndex = (playerIndex + 1) % numPlayers;
        });
      });
    }

    const votingCards = {};
    players.forEach(name => {
      votingCards[name] = ['Yes_1', 'Yes_2', 'Yes_3', 'No_1', 'No_2', 'No_3', 'Wildcard', 'Indifferent'];
    });

    const scores = {};
    players.forEach(name => scores[name] = 15);

    return {
      started: true,
      board,
      workers,
      tiles: dealtTiles,
      secretBuildings,
      votingCards,
      scores,
      currentPlayer: 0,
      placedTiles: [],
      gameEnded: false,
      winner: null,
      pendingVote: null,
      voteSelections: {},
      voteSubmitted: {},
      voteRevealStartedAt: null,
      voteResolution: null,
      lastActionMessage: 'New game started!'
    };
  };

  const getNextPlayableTurn = (players, currentIndex, tilesState, boardState, workersState, placedTilesState) => {
    for(let offset = 0; offset < players.length; offset++) {
      const idx = (currentIndex + offset) % players.length;
      const pTiles = tilesState[players[idx]] || [];
      const hasMoves = pTiles.some(t => calcMovesForState(t, boardState, workersState, placedTilesState).length > 0);
      if(hasMoves) return {hasAnyMoves: true, nextPlayerIndex: idx};
    }
    return {hasAnyMoves: false, nextPlayerIndex: null};
  };

  const getWinnerName = (scoresState) => (
    Object.keys(scoresState).reduce((a, b) => scoresState[a] > scoresState[b] ? a : b)
  );

  const checkOuthouses = (cells) => cells.some(([c, r]) => OUTHOUSES.some(([oc, or]) => oc === c && or === r));

  const getTileImageLayout = (x, y, w, h, rotation) => {
    const normalizedRotation = ((rotation % 360) + 360) % 360;
    const isHorizontal = normalizedRotation === 90 || normalizedRotation === 270;
    if(!isHorizontal) return {x, y, width: w, height: h};
    return {x: x + (w - h) / 2, y: y + (h - w) / 2, width: h, height: w};
  };

  const onDragStart = (e, tile) => {
    if (myPlayerIndex !== gameState.currentPlayer || gameState.pendingVote || gameState.gameEnded) return;
    e.dataTransfer.effectAllowed = 'move';
    setDragging(tile);
    const placedTilesArray = normalizeCollection(gameState.placedTiles);
    const moves = calcMovesForState(tile, gameState.board, gameState.workers, placedTilesArray);
    setValidMoves(moves);
    setDragPos({x: e.clientX, y: e.clientY});
  };

  const onDrag = (e) => {
    if(e.clientX !== 0 && e.clientY !== 0) {
      setDragPos({x: e.clientX, y: e.clientY});
    }
  };

  const onDragEnd = () => {
    setDragging(null);
    setValidMoves([]);
    setPreviewMove(null);
  };

  const onDragOver = (e) => {
    e.preventDefault();
    e.stopPropagation();
    if(!dragging || !boardRef.current) return;
    const rect = boardRef.current.getBoundingClientRect();
    const svgX = ((e.clientX - rect.left) / rect.width) * 2000;
    const svgY = ((e.clientY - rect.top) / rect.height) * 1426;
    let hoverCell = null;
    for(let c=0; c<15; c++) {
      for(let r=0; r<10; r++) {
        if(svgX >= V[c] && svgX < V[c+1] && svgY >= H[r] && svgY < H[r+1]) {
          hoverCell = {c, r};
          break;
        }
      }
      if(hoverCell) break;
    }
    if(!hoverCell) {
      setPreviewMove(null);
      return;
    }
    const move = validMoves.find(m => m.cells.some(([c,r]) => c===hoverCell.c && r===hoverCell.r));
    setPreviewMove(move || null);
  };

  const onDrop = async (e) => {
    e.preventDefault();
    e.stopPropagation();
    if(!dragging || !boardRef.current) return;
    const rect = boardRef.current.getBoundingClientRect();
    const svgX = ((e.clientX - rect.left) / rect.width) * 2000;
    const svgY = ((e.clientY - rect.top) / rect.height) * 1426;
    let dropCell = null;
    for(let c=0; c<15; c++) {
      for(let r=0; r<10; r++) {
        if(svgX >= V[c] && svgX < V[c+1] && svgY >= H[r] && svgY < H[r+1]) {
          dropCell = {c, r};
          break;
        }
      }
      if(dropCell) break;
    }
    if(!dropCell) return;
    const moveToPlace = validMoves.find(m => m.cells.some(([c,r]) => c===dropCell.c && r===dropCell.r));
    if(!moveToPlace) return;
    
    if(checkOuthouses(moveToPlace.cells)) {
      await update(ref(database, `rooms/${roomId}`), {
        pendingVote: {move: moveToPlace, tile: dragging},
        voteSelections: {},
        voteSubmitted: {}
      });
      setDragging(null);
      setValidMoves([]);
      setPreviewMove(null);
      return;
    }
    
    await placeTile(moveToPlace, dragging);
  };

  const placeTile = async (move, tile) => {
    const players = getNormalizedPlayers(gameState.players).map(p => p.name);
    const nb = gameState.board.map(r => r.map(c => ({...c})));
    move.cells.forEach(([c,r]) => { nb[r][c].covered = true; });
    const currentPlacedTiles = normalizeCollection(gameState.placedTiles);
    const newPlacedTiles = [...currentPlacedTiles, {type: tile.type, cells: move.cells, rotation: move.rot, size: tile.size}];
    const [lc,lr] = move.cells[move.cells.length-1];
    const nw = {...gameState.workers};
    nw[move.track] = {c:lc, r:lr};
    const pn = players[gameState.currentPlayer];
    const nt = {...gameState.tiles};
    nt[pn] = nt[pn].filter(t => t.id !== tile.id);

    const newScores = calculateScores(nb, gameState.secretBuildings, players);
    const turnResult = getNextPlayableTurn(players, (gameState.currentPlayer + 1) % players.length, nt, nb, nw, newPlacedTiles);

    const updates = {
      board: nb,
      placedTiles: newPlacedTiles,
      workers: nw,
      tiles: nt,
      scores: newScores
    };

    if(!turnResult.hasAnyMoves) {
      updates.gameEnded = true;
      updates.winner = getWinnerName(newScores);
      updates.lastActionMessage = 'No players have any legal moves left. Game over!';
    } else {
      updates.currentPlayer = turnResult.nextPlayerIndex;
      const skippedCount = (turnResult.nextPlayerIndex - ((gameState.currentPlayer + 1) % players.length) + players.length) % players.length;
      updates.lastActionMessage = skippedCount > 0 ? `${players[gameState.currentPlayer]} played. ${skippedCount} player(s) had no legal move and were skipped.` : `${players[gameState.currentPlayer]} played a tile.`;
    }

    await update(ref(database, `rooms/${roomId}`), updates);
    setDragging(null);
    setValidMoves([]);
    setPreviewMove(null);
  };

  const toggleVoteCard = async (card) => {
    if(!myName) return;

    if(card === 'Wildcard') {
      const current = gameState.voteSelections?.[myName] || [];
      const currentWildcard = current.find(c => c.startsWith('Wildcard_'));
      if (currentWildcard) {
        await update(ref(database, `rooms/${roomId}/voteSelections`), {
          [myName]: current.filter(c => !c.startsWith('Wildcard_'))
        });
        return;
      }

      setWildcardChoice({player: myName, callback: async (choice) => {
        const freshCurrent = gameState.voteSelections?.[myName] || [];
        await update(ref(database, `rooms/${roomId}/voteSelections`), {
          [myName]: [...freshCurrent.filter(c => !c.startsWith('Wildcard_')), `Wildcard_${choice}`]
        });
        setWildcardChoice(null);
      }});
      return;
    }
    
    const current = gameState.voteSelections?.[myName] || [];
    if(current.includes(card)) {
      await update(ref(database, `rooms/${roomId}/voteSelections`), {
        [myName]: current.filter(c => c !== card)
      });
    } else {
      await update(ref(database, `rooms/${roomId}/voteSelections`), {
        [myName]: [...current, card]
      });
    }
  };

  const submitMyVote = async () => {
    if(!myName) return;
    const selectedCards = gameState.voteSelections?.[myName] || [];
    if(selectedCards.length === 0) return;

    await update(ref(database, `rooms/${roomId}/voteSubmitted`), {
      [myName]: true
    });

    const roomPath = ref(database, `rooms/${roomId}`);
    await runTransaction(roomPath, (room) => {
      if (!room || !room.pendingVote) return room;
      const playersList = normalizeCollection(room.players).map(p => p.name);
      const submitted = room.voteSubmitted || {};
      const everyoneDone = playersList.length > 0 && playersList.every((player) => submitted[player]);
      if (!everyoneDone || room.voteRevealStartedAt) return room;

      let yesVotes = 0, noVotes = 0;
      const usedCards = [];
      Object.entries(room.voteSelections || {}).forEach(([player, cards]) => {
        cards.forEach((card) => {
          if(card.startsWith('Yes')) yesVotes += parseInt(card.split('_')[1]);
          else if(card.startsWith('No')) noVotes += parseInt(card.split('_')[1]);
          else if(card === 'Wildcard_Yes') yesVotes += 2;
          else if(card === 'Wildcard_No') noVotes += 2;
          if(card !== 'Indifferent') usedCards.push({player, card: card.startsWith('Wildcard') ? 'Wildcard' : card});
        });
      });

      const votingCards = {...room.votingCards};
      usedCards.forEach(({player, card}) => {
        votingCards[player] = (votingCards[player] || []).filter(c => c !== card);
      });

      room.voteRevealStartedAt = Date.now();
      room.voteResolution = {
        yesVotes,
        noVotes,
        votePass: yesVotes >= noVotes,
        votingCards
      };
      return room;
    });
  };

  const processVoteAndFinalize = async () => {
    await runTransaction(ref(database, `rooms/${roomId}`), (room) => {
      if (!room || !room.pendingVote || !room.voteResolution) return room;

      const playersList = normalizeCollection(room.players).map(p => p.name);
      const resolution = room.voteResolution;
      room.votingCards = resolution.votingCards || room.votingCards;

      if (resolution.votePass) {
        const move = room.pendingVote.move;
        const tile = room.pendingVote.tile;

        const nb = room.board.map(r => r.map(c => ({...c})));
        move.cells.forEach(([c,r]) => { nb[r][c].covered = true; });
        const currentPlacedTiles = normalizeCollection(room.placedTiles);
        const newPlacedTiles = [...currentPlacedTiles, {type: tile.type, cells: move.cells, rotation: move.rot, size: tile.size}];
        const [lc,lr] = move.cells[move.cells.length-1];
        const nw = {...room.workers};
        nw[move.track] = {c:lc, r:lr};

        const pn = playersList[room.currentPlayer];
        const nt = {...room.tiles};
        nt[pn] = (nt[pn] || []).filter(t => t.id !== tile.id);

        const newScores = calculateScores(nb, room.secretBuildings, playersList);
        const turnResult = getNextPlayableTurn(playersList, (room.currentPlayer + 1) % playersList.length, nt, nb, nw, newPlacedTiles);

        room.board = nb;
        room.placedTiles = newPlacedTiles;
        room.workers = nw;
        room.tiles = nt;
        room.scores = newScores;

        if(!turnResult.hasAnyMoves) {
          room.gameEnded = true;
          room.winner = getWinnerName(newScores);
          room.lastActionMessage = 'No players have any legal moves left. Game over!';
        } else {
          const previousCurrentPlayer = room.currentPlayer;
          room.currentPlayer = turnResult.nextPlayerIndex;
          const skippedCount = (turnResult.nextPlayerIndex - ((previousCurrentPlayer + 1) % playersList.length) + playersList.length) % playersList.length;
          room.lastActionMessage = skippedCount > 0 ? `${pn} played. ${skippedCount} player(s) had no legal move and were skipped.` : `${pn} played a tile.`;
        }
      } else {
        const turnResult = getNextPlayableTurn(playersList, (room.currentPlayer + 1) % playersList.length, room.tiles, room.board, room.workers, normalizeCollection(room.placedTiles));
        const scoresNow = calculateScores(room.board, room.secretBuildings, playersList);
        room.currentPlayer = turnResult.nextPlayerIndex ?? room.currentPlayer;
        room.gameEnded = !turnResult.hasAnyMoves;
        room.winner = !turnResult.hasAnyMoves ? getWinnerName(scoresNow) : null;
        room.scores = scoresNow;
        room.lastActionMessage = !turnResult.hasAnyMoves
          ? 'Vote failed, and no players have any legal moves left. Game over!'
          : 'Vote failed. Turn passes to the next player with a legal move.';
      }

      room.pendingVote = null;
      room.voteSelections = {};
      room.voteSubmitted = {};
      room.voteRevealStartedAt = null;
      room.voteResolution = null;
      return room;
    });
  };

  useEffect(() => {
    if (!gameState?.pendingVote || !gameState?.voteRevealStartedAt) return;

    const elapsed = Date.now() - gameState.voteRevealStartedAt;
    const delay = Math.max(0, 3000 - elapsed);
    if (voteRevealTimerRef.current) clearTimeout(voteRevealTimerRef.current);

    voteRevealTimerRef.current = setTimeout(() => {
      processVoteAndFinalize();
    }, delay);

    return () => {
      if (voteRevealTimerRef.current) clearTimeout(voteRevealTimerRef.current);
    };
  }, [gameState?.pendingVote, gameState?.voteRevealStartedAt]);

  const copyRoomLink = () => {
    const link = `${window.location.origin}${window.location.pathname}?room=${roomId}`;
    navigator.clipboard.writeText(link);
    alert('Room link copied! Share it with friends to play together.');
  };

  useEffect(() => {
    if (!gameState?.players || myPlayerIndex === null) return;
    const playersList = getNormalizedPlayers(gameState.players).map(p => p.name);
    const myPlayerName = playersList[myPlayerIndex];
    if (!myPlayerName) return;
    if (!viewedPlayerName || !playersList.includes(viewedPlayerName)) {
      setViewedPlayerName(myPlayerName);
    }
  }, [gameState, myPlayerIndex, viewedPlayerName]);

  // Lobby view - show until game actually starts
  if (inLobby || !gameState || !gameState.started) {
    // Check if we're actually in the room (player exists in gameState)
    const isInRoom = gameState && getNormalizedPlayers(gameState.players).some(p => p.id === playerId);
    
    return (
      <div style={{display:'flex',alignItems:'center',justifyContent:'center',minHeight:'100vh',background:'#D2691E',padding:'20px'}}>
        <div style={{background:'white',padding:'40px',borderRadius:'15px',maxWidth:'500px',width:'100%'}}>
          <h1 style={{margin:'0 0 20px 0',textAlign:'center'}}>Wacky Wacky West</h1>
          
          {!isInRoom ? (
            <div>
              <input
                type="text"
                placeholder="Your Name"
                value={playerName}
                onChange={(e) => setPlayerName(e.target.value)}
                style={{width:'100%',padding:'12px',fontSize:'16px',marginBottom:'15px',borderRadius:'8px',border:'1px solid #ccc'}}
              />
              <button
                onClick={createOrJoinRoom}
                style={{width:'100%',padding:'15px',fontSize:'18px',background:'#FFD700',border:'none',borderRadius:'8px',cursor:'pointer',fontWeight:'bold',marginBottom:'10px'}}
              >
                Create New Room
              </button>
              <div style={{textAlign:'center',margin:'15px 0',color:'#666'}}>- OR -</div>
              <input
                type="text"
                placeholder="Room code or paste full link"
                value={roomId}
                onChange={(e) => {
                  let value = e.target.value;
                  // If user pastes a URL, extract the room code
                  if (value.includes('?room=')) {
                    const match = value.match(/[?&]room=([A-Z0-9]+)/i);
                    if (match) {
                      value = match[1];
                    }
                  }
                  // Clean and uppercase
                  value = value.trim().replace(/[^A-Z0-9]/gi, '').toUpperCase();
                  setRoomId(value);
                }}
                style={{width:'100%',padding:'12px',fontSize:'16px',marginBottom:'15px',borderRadius:'8px',border:'1px solid #ccc'}}
              />
              <input
                type="text"
                placeholder="Your Name"
                value={playerName}
                onChange={(e) => setPlayerName(e.target.value)}
                style={{width:'100%',padding:'12px',fontSize:'16px',marginBottom:'15px',borderRadius:'8px',border:'1px solid #ccc'}}
              />
              <button
                onClick={createOrJoinRoom}
                disabled={!roomId}
                style={{width:'100%',padding:'15px',fontSize:'18px',background:roomId ? '#4CAF50' : '#ccc',border:'none',borderRadius:'8px',cursor:roomId ? 'pointer' : 'not-allowed',fontWeight:'bold'}}
              >
                Join Room
              </button>
            </div>
          ) : (
            <div>
              <div style={{background:'#f5f5f5',padding:'15px',borderRadius:'8px',marginBottom:'20px'}}>
                <div style={{fontSize:'14px',color:'#666',marginBottom:'5px'}}>Room Code:</div>
                <div style={{fontSize:'32px',fontWeight:'bold',textAlign:'center',letterSpacing:'4px'}}>{roomId}</div>
                <button
                  onClick={copyRoomLink}
                  style={{width:'100%',padding:'10px',fontSize:'14px',background:'#4CAF50',color:'white',border:'none',borderRadius:'8px',cursor:'pointer',marginTop:'10px'}}
                >
                   Copy Room Link
                </button>
              </div>
              
              <div style={{marginBottom:'20px'}}>
                <h3 style={{margin:'0 0 10px 0'}}>Players ({gameState?.players?.length || 0}/4):</h3>
                {gameState?.players?.map((p, i) => (
                  <div key={i} style={{padding:'10px',background:p.connected ? '#e8f5e9' : '#ffebee',borderRadius:'5px',marginBottom:'5px',display:'flex',justifyContent:'space-between',alignItems:'center'}}>
                    <span>{p.name} {p.id === gameState.host && <strong title="Host"></strong>}</span>
                    <span style={{fontSize:'12px',color:p.connected ? '#4CAF50' : '#f44336'}}>
                      {p.connected ? ' Connected' : ' Disconnected'}
                    </span>
                  </div>
                ))}
              </div>

              {gameState?.host === playerId && !gameState?.started && (
                <button
                  onClick={startGame}
                  disabled={!gameState?.players || gameState.players.length < 2}
                  style={{width:'100%',padding:'15px',fontSize:'18px',background:gameState?.players?.length >= 2 ? '#FFD700' : '#ccc',border:'none',borderRadius:'8px',cursor:gameState?.players?.length >= 2 ? 'pointer' : 'not-allowed',fontWeight:'bold'}}
                >
                  Start Game (2-4 players)
                </button>
              )}
              
              {gameState?.host !== playerId && !gameState?.started && (
                <div style={{textAlign:'center',color:'#666',padding:'15px'}}>
                  Waiting for host to start the game...
                </div>
              )}
            </div>
          )}
        </div>
      </div>
    );
  }

  // Game has started - render the game board
  // Note: placedTiles not checked here because Firebase omits empty arrays
  // (we handle it with fallbacks in rendering)
  if (!gameState.players || !gameState.board || !gameState.workers || 
      !gameState.tiles || !gameState.secretBuildings || !gameState.votingCards || 
      !gameState.scores || gameState.currentPlayer === undefined || myPlayerIndex === null) {
    
    // Debug: Log what's missing (remove this in production)
    console.log("Loading game - missing data:", {
      hasPlayers: !!gameState.players,
      hasBoard: !!gameState.board,
      hasWorkers: !!gameState.workers,
      hasTiles: !!gameState.tiles,
      hasSecrets: !!gameState.secretBuildings,
      hasVotingCards: !!gameState.votingCards,
      hasScores: !!gameState.scores,
      hasCurrentPlayer: gameState.currentPlayer !== undefined,
      myPlayerIndex: myPlayerIndex
    });
    
    return (
      <div style={{display:'flex',alignItems:'center',justifyContent:'center',minHeight:'100vh',background:'#F5DEB3'}}>
        <div style={{background:'white',padding:'40px',borderRadius:'15px',textAlign:'center'}}>
          <h2>Loading game...</h2>
          <p style={{color:'#666',marginTop:'10px'}}>Please wait a moment</p>
          <p style={{fontSize:'12px',color:'#999',marginTop:'20px'}}>Check browser console (F12) if stuck</p>
        </div>
      </div>
    );
  }

  // Firebase might return players as object or array - handle both
  const playersArray = getNormalizedPlayers(gameState.players);
  const placedTiles = normalizeCollection(gameState.placedTiles);
  const players = playersArray.map(p => p.name);
  const currentPlayerName = players[gameState.currentPlayer];
  const myName = playersArray[myPlayerIndex]?.name;
  const selectedPlayerName = viewedPlayerName || myName;
  const voteSelections = gameState.voteSelections || {};
  const voteSubmitted = gameState.voteSubmitted || {};
  const allVotesSubmitted = gameState.pendingVote && players.every(p => voteSubmitted[p]);
  const myVoteSubmitted = myName ? !!voteSubmitted[myName] : false;

  return (
    <div style={{padding:'15px',background:'#F5DEB3',minHeight:'100vh'}}>
      {/* Header */}
      <div style={{marginBottom:'15px',background:'white',padding:'12px 20px',borderRadius:'10px'}}>
        <div style={{display:'flex',justifyContent:'space-between',alignItems:'center',flexWrap:'wrap',gap:'10px'}}>
          <div>
            <h2 style={{margin:0}}>Wacky Wacky West - Room {roomId}</h2>
            <div style={{display:'flex',gap:'20px',marginTop:'8px',fontSize:'14px'}}>
              <span>Current Turn: {currentPlayerName}</span>
              <span>Tiles: {(gameState.tiles[currentPlayerName] || []).length}</span>
              <span style={{fontWeight:'bold'}}>Your Score: {myName ? (gameState.scores[myName] ?? 15) : 15} points</span>
            </div>
          </div>

          <div style={{display:'flex',flexDirection:'column',gap:'6px'}}>
            <label style={{fontSize:'12px',fontWeight:'bold'}}>View player hand</label>
            <select value={selectedPlayerName} onChange={(e) => setViewedPlayerName(e.target.value)} style={{padding:'6px',borderRadius:'6px',border:'1px solid #ccc'}}>
              {players.map(p => <option key={p} value={p}>{p}</option>)}
            </select>
          </div>
          
          <div style={{display:'flex',gap:'5px',flexWrap:'wrap',maxWidth:'300px'}}>
            {(gameState.votingCards[selectedPlayerName] || []).map(card => (
              <div key={card} style={{width:'40px',height:'55px',border:'1px solid #ccc',borderRadius:'3px',overflow:'hidden'}}>
                <img src={IMAGES[card]} style={{width:'100%',height:'100%',objectFit:'cover'}} alt={card}/>
              </div>
            ))}
          </div>
        </div>
      </div>

      <div style={{display:'flex',gap:'15px',flexWrap:'wrap'}}>
        {/* Board */}
        <div style={{flex:'0 0 70%',minWidth:'600px'}}>
          <div ref={boardRef} onDragOver={onDragOver} onDrop={onDrop} style={{background:'white',padding:'8px',borderRadius:'10px',position:'relative'}}>
            <img src={IMAGES.board} style={{width:'100%',display:'block',border:'3px solid #8B4513',borderRadius:'5px'}} alt=""/>
            <svg style={{position:'absolute',top:'8px',left:'8px',width:'calc(100% - 16px)',height:'calc(100% - 16px)',pointerEvents:'none'}} viewBox="0 0 2000 1426">
              {dragging && validMoves.map((m,i) => m.cells.map(([c,r],j) => {
                const hover = previewMove?.cells.some(([hc,hr]) => hc===c && hr===r);
                return <rect key={`${i}-${j}`} x={V[c]} y={H[r]} width={V[c+1]-V[c]} height={H[r+1]-H[r]} fill={hover?"yellow":"lime"} opacity={hover?0.7:0.5} stroke={hover?"orange":"yellow"} strokeWidth="5"/>;
              }))}
              {gameState.pendingVote && (() => {
                const minC = Math.min(...gameState.pendingVote.move.cells.map(([c]) => c));
                const maxC = Math.max(...gameState.pendingVote.move.cells.map(([c]) => c));
                const minR = Math.min(...gameState.pendingVote.move.cells.map(([_, r]) => r));
                const maxR = Math.max(...gameState.pendingVote.move.cells.map(([_, r]) => r));
                return <rect x={V[minC]} y={H[minR]} width={V[maxC+1]-V[minC]} height={H[maxR+1]-H[minR]} fill="orange" opacity="0.5" stroke="red" strokeWidth="8"/>;
              })()}
              {previewMove && dragging && (() => {
                const minC = Math.min(...previewMove.cells.map(([c]) => c));
                const maxC = Math.max(...previewMove.cells.map(([c]) => c));
                const minR = Math.min(...previewMove.cells.map(([_, r]) => r));
                const maxR = Math.max(...previewMove.cells.map(([_, r]) => r));
                const x = V[minC], y = H[minR], w = V[maxC + 1] - V[minC], h = H[maxR + 1] - H[minR];
                const centerX = x + w / 2, centerY = y + h / 2;
                const adjustedRot = previewMove.rot + 90;
                const imageLayout = getTileImageLayout(x, y, w, h, adjustedRot);
                return <image x={imageLayout.x} y={imageLayout.y} width={imageLayout.width} height={imageLayout.height} href={IMAGES[dragging.type]} preserveAspectRatio="xMidYMid meet" opacity="0.7" transform={`rotate(${adjustedRot} ${centerX} ${centerY})`}/>;
              })()}
              {placedTiles.map((tile, idx) => {
                const minC = Math.min(...tile.cells.map(([c]) => c));
                const maxC = Math.max(...tile.cells.map(([c]) => c));
                const minR = Math.min(...tile.cells.map(([_, r]) => r));
                const maxR = Math.max(...tile.cells.map(([_, r]) => r));
                const x = V[minC], y = H[minR], w = V[maxC + 1] - V[minC], h = H[maxR + 1] - H[minR];
                const centerX = x + w / 2, centerY = y + h / 2;
                const adjustedRot = tile.rotation + 90;
                const imageLayout = getTileImageLayout(x, y, w, h, adjustedRot);
                return (
                  <image 
                    key={`tile-${idx}`} 
                    x={imageLayout.x} 
                    y={imageLayout.y} 
                    width={imageLayout.width} 
                    height={imageLayout.height} 
                    href={IMAGES[tile.type]} 
                    preserveAspectRatio="xMidYMid meet" 
                    transform={`rotate(${adjustedRot} ${centerX} ${centerY})`}
                    opacity={hoveredTileIndex === idx ? 0.4 : 1}
                    style={{cursor: 'pointer', pointerEvents: 'all'}}
                    onMouseEnter={() => setHoveredTileIndex(idx)}
                    onMouseLeave={() => setHoveredTileIndex(null)}
                  />
                );
              })}
              {Object.entries(gameState.workers || {}).filter(([, w]) => w && Number.isInteger(w.c) && Number.isInteger(w.r)).map(([n,w]) => <image key={n} x={V[w.c]+20} y={H[w.r]+20} width={V[w.c+1]-V[w.c]-40} height={H[w.r+1]-H[w.r]-40} href={IMAGES.worker} preserveAspectRatio="xMidYMid meet" style={{}}/>) }
            </svg>
          </div>
        </div>

        {/* Sidebar */}
        <div style={{flex:'0 0 28%',display:'flex',flexDirection:'column',gap:'10px',maxHeight:'85vh'}}>
          {/* Secret Building - only show current player's secret */}
          {!gameState.gameEnded && (
            <div style={{background:'white',padding:'10px',borderRadius:'10px'}}>
              <h4 style={{margin:'0 0 8px 0',fontSize:'13px'}}>{selectedPlayerName === myName ? 'Your Secret' : `${selectedPlayerName}'s Secret`}: {gameState.secretBuildings[selectedPlayerName]?.replace(/_/g,' ')}</h4>
              <img src={IMAGES[gameState.secretBuildings[selectedPlayerName]]} style={{width:'100%',maxHeight:'100px',objectFit:'contain'}} alt=""/>
            </div>
          )}

          {/* Game Over - Show all secrets */}
          {gameState.gameEnded && (
            <div style={{background:'white',padding:'10px',borderRadius:'10px',maxHeight:'200px',overflowY:'auto'}}>
              <h4 style={{margin:'0 0 8px 0',fontSize:'13px'}}>Secret Buildings:</h4>
              {players.map(p => (
                <div key={p} style={{marginBottom:'10px',paddingBottom:'10px',borderBottom:'1px solid #eee'}}>
                  <div style={{fontSize:'12px',fontWeight:'bold',marginBottom:'4px'}}>{p}</div>
                  <div style={{fontSize:'11px',marginBottom:'4px'}}>{gameState.secretBuildings[p]?.replace(/_/g,' ')}</div>
                  <img src={IMAGES[gameState.secretBuildings[p]]} style={{width:'100%',maxHeight:'60px',objectFit:'contain'}} alt=""/>
                </div>
              ))}
            </div>
          )}

          {/* Current Player's Tiles */}
          <div style={{background:'white',padding:'10px',borderRadius:'10px',flex:1,display:'flex',flexDirection:'column',minHeight:0,overflow:'hidden'}}>
            <h4 style={{margin:'0 0 8px 0',fontSize:'13px'}}>
              {selectedPlayerName === myName ? 'Your Tiles' : `${selectedPlayerName}'s Tiles`} ({(gameState.tiles[selectedPlayerName] || []).length})
            </h4>
            <div style={{overflowY:'auto',flex:1,paddingRight:'5px'}}>
              <div style={{display:'grid',gridTemplateColumns:'repeat(3,1fr)',gap:'8px',alignContent:'start'}}>
                {(gameState.tiles[selectedPlayerName] || []).map(t => (
                  <div 
                    key={`${selectedPlayerName}-${t.id}`} 
                    draggable={selectedPlayerName === myName && myPlayerIndex === gameState.currentPlayer && !gameState.pendingVote && !gameState.gameEnded} 
                    onDragStart={(e)=>onDragStart(e,t)} 
                    onDrag={onDrag} 
                    onDragEnd={onDragEnd}
                    style={{
                      height:'80px',
                      border:'1px solid #ccc',
                      borderRadius:'4px',
                      cursor: selectedPlayerName === myName && myPlayerIndex === gameState.currentPlayer && !gameState.pendingVote && !gameState.gameEnded ? 'grab' : 'default',
                      padding:'4px',
                      background:'white',
                      opacity: dragging?.id === t.id ? 0 : 1,
                      display:'flex',
                      alignItems:'center',
                      justifyContent:'center'
                    }}
                  >
                    <img src={IMAGES[t.type]} style={{maxWidth:'100%',maxHeight:'100%',width:'auto',height:'auto',objectFit:'contain',display:'block',pointerEvents:'none'}} alt="" draggable={false}/>
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Dragging preview */}
      {dragging && (
        <div style={{position:'fixed',left:dragPos.x,top:dragPos.y,transform:'translate(-50%, -50%)',pointerEvents:'none',zIndex:10000}}>
          <img src={IMAGES[dragging.type]} style={{width:'auto',maxWidth:'120px',height:'auto',maxHeight:'120px',objectFit:'contain',opacity:0.9,background:'white',border:'2px solid #333',borderRadius:'4px',padding:'3px'}} alt="" draggable={false}/>
        </div>
      )}

      {/* Wildcard choice */}
      {wildcardChoice && (
        <div style={{position:'fixed',top:0,left:0,right:0,bottom:0,background:'rgba(0,0,0,0.5)',display:'flex',alignItems:'center',justifyContent:'center',zIndex:2000}}>
          <div style={{background:'white',padding:'30px',borderRadius:'15px',textAlign:'center'}}>
            <h3>Use Wildcard as:</h3>
            <div style={{display:'flex',gap:'20px',marginTop:'20px'}}>
              <button onClick={() => wildcardChoice.callback('Yes')} style={{padding:'15px 30px',fontSize:'18px',background:'#90EE90',border:'none',borderRadius:'8px',cursor:'pointer'}}>Yes 2</button>
              <button onClick={() => wildcardChoice.callback('No')} style={{padding:'15px 30px',fontSize:'18px',background:'#FFB6C1',border:'none',borderRadius:'8px',cursor:'pointer'}}>No 2</button>
            </div>
          </div>
        </div>
      )}

      {/* Voting panel */}
      {gameState.pendingVote && !wildcardChoice && (
        <div style={{position:'fixed',right:'20px',top:'120px',background:'white',padding:'20px',borderRadius:'15px',boxShadow:'0 4px 20px rgba(0,0,0,0.3)',zIndex:1000,maxHeight:'70vh',overflowY:'auto',width:'320px'}}>
          <h3 style={{margin:'0 0 15px 0'}}>Outhouse - Vote!</h3>
          {!allVotesSubmitted ? (
            <>
              <p style={{fontSize:'12px',color:'#555',margin:'0 0 10px 0'}}>
                Each player votes privately on their own screen. Votes are revealed after everyone submits.
              </p>
              <div style={{marginBottom:'15px'}}>
                <h4 style={{margin:'5px 0'}}>Your vote ({myName})</h4>
                <div style={{display:'grid',gridTemplateColumns:'repeat(4,1fr)',gap:'6px'}}>
                  {(gameState.votingCards?.[myName] || []).map(card => {
                    const selected = (voteSelections[myName] || []).some(c => c === card || c.startsWith(card));
                    return (
                      <div 
                        key={card} 
                        onClick={() => !myVoteSubmitted && toggleVoteCard(card)} 
                        style={{
                          border: selected ? '3px solid #FFD700' : '2px solid #ccc',
                          padding:'3px',
                          cursor: myVoteSubmitted ? 'not-allowed' : 'pointer',
                          borderRadius:'4px',
                          background: selected ? '#FFFACD' : 'white',
                          opacity: myVoteSubmitted ? 0.6 : 1
                        }}
                      >
                        <img src={IMAGES[card]} style={{width:'100%',display:'block'}} alt={card}/>
                      </div>
                    );
                  })}
                </div>
                {voteSelections[myName] && voteSelections[myName].length > 0 && (
                  <div style={{marginTop:'5px',fontSize:'11px',color:'#666'}}>
                    Selected: {voteSelections[myName].join(', ')}
                  </div>
                )}
              </div>
              <div style={{fontSize:'12px',marginBottom:'10px',color:'#444'}}>
                Submitted: {players.filter(p => voteSubmitted[p]).length} / {players.length}
              </div>
              <button 
                onClick={submitMyVote}
                disabled={myVoteSubmitted || !(voteSelections[myName]?.length > 0)}
                style={{
                  padding:'12px 30px',
                  fontSize:'16px',
                  background: myVoteSubmitted ? '#90EE90' : (voteSelections[myName]?.length > 0 ? '#FFD700' : '#ccc'),
                  border:'none',
                  borderRadius:'10px',
                  cursor: myVoteSubmitted || !(voteSelections[myName]?.length > 0) ? 'not-allowed' : 'pointer',
                  fontWeight:'bold',
                  width:'100%'
                }}
              >
                {myVoteSubmitted ? 'Vote Submitted' : 'Submit Vote'}
              </button>
            </>
          ) : (
            <>
              {players.map(player => (
                <div key={player} style={{marginBottom:'15px'}}>
                  <h4 style={{margin:'5px 0'}}>{player}</h4>
                  <div style={{marginTop:'5px',fontSize:'11px',color:'#666'}}>
                    Selected: {(voteSelections[player] || []).join(', ') || 'No cards selected'}
                  </div>
                </div>
              ))}
              <div style={{marginTop:'12px',fontSize:'12px',color:'#555'}}>
                Votes revealed. Resolving automatically...
              </div>
            </>
          )}
        </div>
      )}

      {/* Game over */}
      {gameState.gameEnded && (
        <div style={{position:'fixed',right:'20px',bottom:'20px',background:'rgba(255,255,255,0.96)',padding:'24px',borderRadius:'15px',textAlign:'center',maxWidth:'400px',zIndex:1000,boxShadow:'0 8px 25px rgba(0,0,0,0.3)'}}>
          <div>
            <h1 style={{margin:'0 0 20px 0',color:'#FFD700'}}>Game Over!</h1>
            <h2 style={{margin:'0 0 30px 0'}}>{gameState.winner} Wins!</h2>
            {gameState.lastActionMessage && <div style={{fontSize:'13px',marginBottom:'14px',color:'#555'}}>{gameState.lastActionMessage}</div>}
            <div style={{marginBottom:'20px',fontSize:'18px',fontWeight:'bold'}}>
              Your Score: {myName ? (gameState.scores?.[myName] ?? 15) : 15} points
            </div>
            <div style={{textAlign:'left',marginBottom:'18px',maxHeight:'160px',overflowY:'auto',padding:'10px',border:'1px solid #ddd',borderRadius:'8px'}}>
              <div style={{fontWeight:'bold',marginBottom:'8px'}}>Final secrets:</div>
              {players.map(player => (
                <div key={`final-${player}`} style={{fontSize:'13px',marginBottom:'6px'}}>
                  {player}: {gameState.secretBuildings[player]?.replace(/_/g,' ')}
                </div>
              ))}
            </div>
            <button onClick={restartGame} disabled={gameState.host !== playerId} style={{padding:'15px 30px',fontSize:'18px',background:gameState.host === playerId ? '#FFD700' : '#ccc',border:'none',borderRadius:'8px',cursor:gameState.host === playerId ? 'pointer' : 'not-allowed',fontWeight:'bold'}}>
              Play Again
            </button>
          </div>
        </div>
      )}

      {!gameState.gameEnded && gameState.lastActionMessage && (
        <div style={{position:'fixed',left:'20px',bottom:'20px',background:'rgba(255,255,255,0.95)',padding:'10px 14px',borderRadius:'10px',fontSize:'13px',boxShadow:'0 4px 10px rgba(0,0,0,0.2)',zIndex:900}}>
          {gameState.lastActionMessage}
        </div>
      )}
    </div>
  );
}
